import React from 'react'
import { Link } from "react-router-dom";
export default function Footer() {
    
  return (
    <>
    <div style={{position:"absolute",bottom:"1px",height:"35px",width:"100%",backgroundColor:"grey",display:"flex",justifyContent:"center",alignItems:"center",flexDirection:"colomn"}}>
        <div>
        <Link style={{textDecoration:"none",color:"white",fontSize:"10px"}} to="/">Conditions of Use & Sale</Link>
        <Link style={{textDecoration:"none",color:"white",marginLeft:"10px",fontSize:"10px"}} to="/">Privacy Notice</Link>
        <Link style={{textDecoration:"none",color:"white",marginLeft:"10px",fontSize:"10px"}} to="/">Interest-Based Ads</Link>
        </div>
        <div><p style={{textDecoration:"none",color:"white",fontSize:"10px"}}><i class="fa-regular fa-copyright"></i>Crops, Inc. or its affiliates</p></div>
    </div>
    </>
  )
}
